        if (searchResult[sr].ref === node.original['data-nsd-label-uuid']) {
            return true;
        } 
    } 
    return false;

				this.add({
					id: doc['action-uuid'],

					path: doc.path,
					content: doc.content
				});  
			  }
			}));
